import React from 'react';
import './App.css';
import ThemeContext from './family/themeContext';
import Child from './family/Child';

function App ()
{
  return (
    <div className="App">
      <ThemeContext.Provider value='blue'>
        <Child />
      </ThemeContext.Provider>
    </div>
  );
}

export default App;
